import React from 'react';
import { useState } from 'react';
import './App.css';
import Commits from './components/Commits';
import Repos from './components/Repos';
import Home from './components/Home';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {
  const [search, setSearch] = useState('');

  return (
    <Router>
    <div>
      <h1>Search for a GitHub organization</h1>
      <div>
        <div>
          <form>
            <div>
              <label htmlFor="githubOrgSearch" hidden>
                Search for GitHub organization
              </label>
              <input
                  value={search}
                  onChange={(e) => setSearch(e.target.value)}
                  type="text"
                  className="form-control"
                  id="githubOrgSearch"
                  aria-describedby="githubOrgSearch"
                  placeholder="Search for a GitHub Organization"
                />
            </div>
            <button type="submit" className="btn btn-primary">
              Search
            </button>
          </form>
        </div>
      </div>
      <Routes>
          <Route eaxct path='/' Component={Home}/>
          <Route eaxct path='/repos' Component={Repos}/>
          <Route eaxct path='/commits' Component={Commits}/>
      </Routes>
    </div>
    </Router>
  );
}

export default App;
